import React from 'react';

const InvestorForm: React.FC = () => {
  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    const formData = new FormData(e.currentTarget);

    const res = await fetch('http://localhost:3000/api/investors', {
      method: 'POST',
      body: formData,
    });

    if (res.ok) {
      alert('Investor submitted successfully');
      e.currentTarget.reset();
    } else {
      const error = await res.json();
      alert('Error: ' + (error.errors || error.message));
    }
  };

  return (
    <form onSubmit={handleSubmit} encType="multipart/form-data">
      <div>
        <label>First Name:</label>
        <input name="investor[first_name]" type="text" required />
      </div>
      <div>
        <label>Last Name:</label>
        <input name="investor[last_name]" type="text" required />
      </div>
      <div>
        <label>Date of Birth:</label>
        <input name="investor[date_of_birth]" type="date" required />
      </div>
      <div>
        <label>Phone Number:</label>
        <input name="investor[phone_number]" type="tel" required />
      </div>
      <div>
        <label>Street Address:</label>
        <input name="investor[street_address]" type="text" required />
      </div>
      <div>
        <label>State:</label>
        <input name="investor[state]" type="text" required />
      </div>
      <div>
        <label>Zip Code:</label>
        <input name="investor[zip_code]" type="text" required />
      </div>
      <div>
        <label>Documents:</label>
        <input name="files[]" type="file" multiple required />
      </div>
      <button type="submit">Submit Investor</button>
    </form>
  );
};

export default InvestorForm;
